Functions
A function is an independent section of code that maps one or more input parameters to one or more output parameters.
A functions allow to execute a section of code one or more times.
Also, a function allows to break a large job into smaller pieces on which programmers can work independently.
func average(xs []float64) float64 {
    total := 0.0
    for _, v := range xs {
        total += v
    }
    return total / float64(len(xs))
}

func main() {
    vals := []float64{98, 93, 77, 82, 83}
    fmt.Println(average(vals)) // 86.6
}

range over a slice returns two parameters: index and value. The _ tells the compiler to ignore the index.
Variadic functions
func add(args ...int) int {
    total := 0
    for _, v := range args {
        total += v
    }
    return total
}

func main() {
    vals := []int{1, 2, 3}
    fmt.Println(add(vals...)) // 6
}

