Recursion
A function is able to call itself.
func factorial(x uint) uint {
    if x == 0 {
        return 1
    }
    return x * factorial(x-1)
}

func main() {
    fmt.Printf("%d\n", factorial(6)) // 720
}

defer, panic and recover
func main() {
    defer func() {
        str := recover()
        fmt.Println(str) // PANIC
    }()
    panic("PANIC")
}

The defer keyword postpone the execution of func() after the main function finishes.
This behaviour is useful to avoid crashing a program when it triggers an error.
panic will terminate the program but recover that is run after panic catch the error and stops the program prom terminating.
Pointers
For an overview on pointers check variables section.
When we pass an argument to the function the argument will be copied.

func zero(x int) {
    x = 0
}
func main() {
    x := 5
    zero(x)
    fmt.Println(x) // x is still 5 
}

To modify the variable we pass his memory address as argument:
func zero(xPtr *int) {
    *xPtr = 0
}
func main() {
    x := 5
    zero(&x)
    fmt.Println(x) // x is 0
}

new
func one(xPtr *int) {
    *xPtr = 1
}
func main() {
    xPtr := new(int)
    one(xPtr)
    fmt.Println(*xPtr) // x is 1
}

Another way to get a pointer is to use the built in function new.

syntax/OOP.html.body:
Object Oriented Programming
Object oriented Programming (OOP) is a paradigm accepted in industry and education that 
creates an object, which is a value or variable that has associated methods that are functions associated to a particular type.
Below is an example with a method Seconds from standard library.
const day = 24 * time.Hour
fmt.Println(day.Seconds()) // "86400"

Methods Declarations
Methods are declared with an extra parameter that appears before the function name.
type Point struct{ X, Y float64 }

// traditional function
func Distance(p, q Point) float64 {
    return math.Hypot(q.X-p.X, q.Y-p.Y)
}

// same thing, but as a method of the Point type
func (p Point) Distance(q Point) float64 {
    return math.Hypot(q.X-p.X, q.Y-p.Y)
}

func main() {
    p := Point{1, 2}
    q := Point{4, 6}
    fmt.Println(Distance(p, q)) // "5", function call
    fmt.Println(p.Distance(q))  // "5", method call
}

Methods can be associated with any named types defined into the same package
as long as the underluing type is neither a pointer or an interface.
Methods with pointer receiver
Calling a function makes a copy of each argument value.
To avoid copying large quantities of memory we pass the address of variable using a pointer. (See variables).
The same goes for methods, if a method needs to update a pointer receiver we pass the address memory of type as pointer.
func (p *Point) ScaleBy(factor float64) {
     p.X *= factor
     p.Y *= factor
 }

// call (*Point).ScaleBy method 
r := &Point{1, 2}
r.ScaleBy(2)
fmt.Println(*r) // "{2, 4}"

// alternative syntax
p := Point{1, 2}
pptr := &p
pptr.ScaleBy(2)
fmt.Println(p) // "{2, 4}"

// alternative syntax
p := Point{1, 2}
(&p).ScaleBy(2)
fmt.Println(p) // "{2, 4}"

Go allows to avoid the two alternative syntax with:
p.ScaleBy(2)

and the compiler will perform an implicit &p on the variable.
But we can not do this:
Point{1, 2}.ScaleBy(2) // compile error: can't take address of Point literal

because we cannot call a *Point method on a temporary value.
nil value
On methods passing nil as value is correct because nil is a meaningful zero data type for slices and maps.

syntax/interfaces.html.body:
Interfaces
Interfaces are an abstract type. They describe the behaviour that other types need to have.
type Shape interface {
    area() float64
}

Interfaces are created with interface keyword and contains methods that other types need to implement.
Implement an interface
type Circle struct {
    r float64
}

func (c *Circle) area() float64 {
    return math.Pi * (c.r * c.r)
}

type Rectangle struct {
    l, w float64
}

func (r *Rectangle) area() float64 {
    return r.l * r.w
}

Circle and Rectangle has two methods that implements the Shape
interface by using the area method defined by Shape. Now, both Circle and Rectangle are shapes and 
we can write a generic function that both Circle and Rectangle can use:
func totalArea(shapes ...Shape) float64 { 
    var area float64
    for _, s := range shapes { 
        area += s.area()
    }
    return area
}

func main() {
    c := &Circle{5}
    r := &Rectangle{5, 10}
    t := totalArea(c, r)
    fmt.Println(t)
}

Interfaces helped us to use c and r as one type for totalArea.

