Packages
Packages is a mechanism that allow the reuse of code.
import "fmt"

fmt is the name of package that includes functions to format and output on the screen.
Packages are useful to:

avoid overlapping names and keeping meaningful function names
organize code
compilation of code is done once.

Create a package
Make a directory inside gopath folder mkdir -p src/Play/math and insert into math.go file:
// math.go

package math

func Average(xs []float64) float64 {
    total := float64(0)
    for _, x := range xs{
        total += x
    }
    return total / float64(len(xs))
}

Use the directory from main:
package main

import (
    "Play/math"
    "fmt"
)

func main() {
    a := math.Average([]float64{1, 3, 4.5})
    fmt.Println(a) // 2.83333
}

go build and run the executable.

syntax/error-handling.html.body:
Error handling
In Go, the traditional way of signaling errors is to return a value of type error when something goes wrong during the execution of the function.
package main

import (
    "errors"
    "math"
    "log"
    "fmt"
)

func div(a, b float64) (res float64, err error) {
    if b == 0 {
        return math.NaN(), errors.New("not allowed to divide by 0")
    }

    return a + b, nil
}

func main() {
    res, err := div(1, 0)
    if err != nil {
        log.Fatal(err)
    }
    fmt.Println(res)
}

The error type is a built-in interface and, therefore must be implemented before it can be used. 
This is achieved using errors.New()
It is also idiomatic to assign error values to high-level variables so they can be reused throughout a program as needed. 
 var (
      ErrInvalid    = errors.New("invalid argument")
      ErrPermission = errors.New("permission denied")
      ErrExist      = errors.New("file already exists")
      ErrNotExist   = errors.New("file does not exist")
)

